/**
 * @file 为Web入口预加载落地页
 * @module hybrid
 * @author panming <panming@baidu.com>
 */

import hybrid from './index';
import {getParams} from '../utils';
import register from '../register';
register('hybrid/preloadLandingPage', {
    ios: {
        versionRange: ['11.0']
    },
    android: {
        versionRange: ['11.1']
    }
});

/**
 * 为Web入口预加载落地页
 * @function preloadLandingPage
 * @param {object} params
 * @param {array} params.infos
 * @return {Promise}
 */

export default (data = {}) => hybrid(getParams('hybrid-preloadLandingPage', data));
